import React from "react";
import { connect } from "react-redux";
import "./style.css";

class Summary extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { AngularData } = this.props.FinishEnvironmentReducer.EnvironmentResponse;
    console.log("Summary: ", this.props.FinishEnvironmentReducer.EnvironmentResponse);
    return (
      <div className="Summary-main">
        <div className="top-Summary">
          <h2 className="Summmary-heading">Summary</h2>
          <div></div>
        </div>
        <div className="Summmary-content"></div>
        <div class="card">
          <div class="container">
            <p>{AngularData.NodeName}</p>
            <p>{AngularData.NodeVersion}</p>
            <p>{AngularData.NodeVolume}</p>
          </div>
        </div>

        <div className="bottom-Summary "></div>
      </div>
    );
  }
}

